     */
    function _burn(uint256 tokenId) internal virtual {
        address owner = ERC721.ownerOf(tokenId);

        _beforeTokenTransfer(owner, address(0), tokenId);

        // Clear approvals
        _approve(address(0), tokenId);

        // Decrement the pixel count
        pixelCount -= 1;

        // Get index inthe mintedPixels array
        uint256 index;
        bool found = false;
        for (uint256 i = 0; i < mintedPixels.length; i++) {
            if (tokenId == mintedPixels[i]) {
                index = i;
                found = true;
                break;
            }
        }

        // Require thtat the token is in the mintedPixels array
        require(
            found,
            "ERC721: token does not exist in the mintedPixels array"
        );

        // Remove from minted pixels array
        mintedPixels[index] = mintedPixels[mintedPixels.length - 1];
        mintedPixels.pop();

